import Draggable from "react-draggable";
import{ Card} from "react-bootstrap"
import { useDraggble } from "../../contexts/DraggableContext";
import { useRef } from 'react';

export const Circle = () => {
    const {position,handleStop}=useDraggble()
    const draggableRef = useRef(null);
    return (
        <Draggable nodeRef={draggableRef} position={position} onStop={handleStop}>
            <Card  ref={draggableRef}  className="mb-2 rounded-circle">
                <Card.Body className="text-center">Circle</Card.Body>
            </Card>
        </Draggable>
    )
}
